import React from "react";

export default function Navbar() {
  return (
    <div className="navbar">
      <input type="text" placeholder="Search..." />
      <div className="profile">
        <img src="https://via.placeholder.com/40" alt="profile" />
        <span>Admin</span>
      </div>
    </div>
  );
}
